import React from "react";
import { motion, useScroll } from "framer-motion";

function ZakLogo() {
  const { scrollYProgress } = useScroll();

  return (
    <>
      <motion.div
        className="fixed"
        initial={{
          opacity: 1,
        }}
        style={{ scaleX: scrollYProgress }}
        animate={{ opacity: scrollYProgress, scale: 1, x: 20, y: 0 }}
      >
        <h1>زكريا رب</h1>
        <h3>Zakaria Rab</h3>
      </motion.div>
    </>
  );
}

export default ZakLogo;
